	//Dom4J解析xml字符串
	public static Object[] dom4jParxeUserXML(String xml) throws Exception{
		xml = xml.replaceFirst("GBK", "utf-8");
		xml = xml.replaceFirst("gbk", "utf-8");
		try {
			Document document = DocumentHelper.parseText(xml);
			Element root = document.getRootElement();
			Element headElement = root.element("head");
			String yhdh = headElement.elementTextTrim("yhdh");
			String ip = headElement.elementTextTrim("ip");
			String lsh = headElement.elementTextTrim("lsh");
			if(!StringUtil.isNull(yhdh)){
				Object[] objs = new Object[3];
				objs[0] = yhdh;
				objs[1] = ip;
				objs[2] = lsh;
				return objs;
			}
		} catch (Exception e) {
			e.printStackTrace();
			throw e;
		}
		return null;
	}
	
	//Dom4J解析xml字符串
	public static Object[] dom4jParxeUXMLUpdatepwd(String xml) throws Exception{
		xml = xml.replaceFirst("GBK", "utf-8");
		xml = xml.replaceFirst("gbk", "utf-8");
		try {
			Document document = DocumentHelper.parseText(xml);
			Element root = document.getRootElement();
			Element headElement = root.element("head");
			String yhdh = headElement.elementTextTrim("yhdh");
			String ip = headElement.elementTextTrim("ip");
			String lsh = headElement.elementTextTrim("lsh");
			
			Element bodyElement = root.element("body");
			String oldpwd = bodyElement.elementTextTrim("oldpwd");
			String newpwd = bodyElement.elementTextTrim("newpwd");
			if(!StringUtil.isNull(yhdh)){
				Object[] objs = new Object[5];
				objs[0] = yhdh;
				objs[1] = ip;
				objs[2] = lsh;
				objs[3] = oldpwd;
				objs[4] = newpwd;
				return objs;
			}
		} catch (Exception e) {
			e.printStackTrace();
			throw e;
		}
		return null;
	}
	
	@SuppressWarnings("unchecked")
	public static List dom4jParsePicList(String xml) throws Exception{
		if(!StringUtil.isNull(xml)){
			List list = new ArrayList();
			try {
				Document document = DocumentHelper.parseText(xml);
				Element root = document.getRootElement();
				Element picsElement = root.element("pictures");
				for(Iterator i_pe = picsElement.elementIterator(); i_pe.hasNext();){
					Element element = (Element)i_pe.next();
					//StringUtil.Base64ToImage(DESCorder.decryptMode(element.getText(), "12345", "utf-8"), "c:\\test.jpg");
					list.add(DESCorder.decryptMode(element.getText(), SysConst.ASCDESC_KEY, "utf-8"));
				}
			} catch (Exception e) {
				e.printStackTrace();
				throw e;
			}
			return list;
		}else{
			return null;
		}
	}
	
